import './Components.css';

const Navbar = ({ name }) => {

    return (
        <nav id=" our-navbar" className="navbar bg-body-tertiary">
            <div className="container-fluid">
                <span className="navbar-text">
                    Welcome, {name} (Admin)!
                </span>
            </div>
        </nav>
    )
}

export default Navbar
